.go-plus-table {
  width: 100%;
  border-collapse: collapse;
  border-spacing: 0;
}
.go-plus-table-header {
  border-bottom: 1px solid transparent;
}
.go-plus-table-row:hover {
  background-color: #009688;
}
.go-plus-table-cell {
  padding: 5px 10px;
}
.go-plus-left-pad {
  padding-left: 24px;
}
